import './App.css';
import {Data} from './Data.js';
import YoutubeItem from './components/youtube/YoutubeItem.js';



function App() {
  return (
    <div className="box">
      {Data.map((item, index) => (
        <YoutubeItem
          key={index}
          img={item.img}
          avt={item.avt}
          titile={item.titile}
          des={item.des}
        >
        </YoutubeItem>
      ))}
    </div>
  );
}



export default App;
